import React from 'react';
import Todos from './components/Todos';
import './App.css';

function App() {
  state = {
    todos: [
      {
        id: 1,
        title: 'Take out the trash',
        completed: false
      },
      {
        id: 2,
        title: 'Dinner',
        completed: false
      },
      {
        id: 3,
        title: 'Meeting',
        completed: false
      },
    ]
  }
  return (
    <div className="App">
      <Todos />
    </div>
  );
}

export default App;
